import React from "react";

function AddlServices() {
  return (
    <div className="serviceCompDivs addlServicesDiv">
      <h1>Additional Services</h1>
      <ul>
        <li>Respite care</li>
        <li>Advanced directive planning</li>
        <li>Funeral planning</li>
        <li>Continued work on life review, vigil planning, legacy project</li>
      </ul>
    </div>
  );
}

export default AddlServices;
